This is a convenience macro. It's not technically required (in fact it's quite easy to never use it) but it makes our life a bit easier. In exchange for some black-box magic, you get better maintainability and better looking code. // Before:
fn build(&self, ctx: &WidgetContext) -> BuildResult { BuildResult::One( Button { child: Text { text: String::from("A Button") }.into(), ..Button::default() }.into() )
} // After:
fn build(&self, ctx: &WidgetContext) -> BuildResult { build!{ Button { child: Text { text: "A Button" } } }
} Doesn't that look nice? Essentially all it is doing is adding .into() to your blocks and adding Default::default() to your structs. Note that it does make many assumptions, notably that every struct will #[derive(Default)].
